// import React from 'react';

var grid = document.getElementById('mainGrid');

for (let i = 0; i < 20; i++) {
    let node = document.createElement("tr");
    grid.appendChild(node);

    let row = grid.lastChild;

    for (let j = 0; j < 51; j++) {
        node = document.createElement("td");
        let a = i + "" + j;

        row.appendChild(node);
        row.lastChild.id = a;
    }
}

document.getElementById("1010").innerHTML ='<i class="fa fa-dot-circle-o" aria-hidden="true"></i>'; // target

function fill(i,j){
    let a = i + "" + j;
    document.getElementById(a).classList.add("abc");
    j++;
}
var j;
for(let i =0;i<10;i++){
    j = 0;
    setTimeout(fill,1000);
}

